`,i.jsx(e.p,{children:"오랜만에 오프라인 컨퍼런스에 참여하여 정보 교류도 하고, 기념품도 받아오는 시간을 갖게 된 것 같습니다. 발표 내용들은 만족하는 것도 있고, 그렇지 않은 것도 있었지만, 대체로 좋은 시간이었던 것 같습니다."}),`
`,i.jsx(e.p,{children:"그중에 “GraphQL 잘 쓰고 계산기요?(오제관/권기범)” 세션에서 우리 회사에도 이런 BFF 서버를 두어서 프론트엔드에서 관리를 한다면, 프론트엔드 코드가 한결 깔끔해질 것 같고, 성능도 어느정도는 상승할 것 같다는 생각이 들었습니다. 그리고 지금 운영중인 가장 큰 프로젝트 또한 언젠가는 vue에서 React로 변경을 해야하는 숙제가 있는데, 이것은 “SSR환경에서의 micro-frontend 구현과 퍼포먼스 향상을 위한 캐시전략(박찬진)” 세션에서 보여준 마이크로 프론트엔드를 이용하여 점진적으로 바꾸어 나가면 될 것 같다는 생각 또한 해 보았습니다."}),`
`,i.jsx(e.p,{children:"이렇게 Deview를 통해서 모든 정보를 얻지는 못 하더라도, 잊혀졌던 키워드만 듣고 온 것 만으로도 저에게는 긍정적인 영향이 있었습니다. 그리고, “눈으로 보며 듣는 음성 기록, 클로바노트 서비스의 웹 기술 톺아보기(임대현/이은성)” 세션의 발표자들의 발표하는 방식이 너무 마음에 들었습니다. 아주 긴 내용이 아주 잘 이해가 되어서, 클로바 노트로 녹음한 내용들 다시 들어보며, 발표하는 방식을 연구해 보려고 합니다."}),`
